  false,\n\t\"url\": null,\n\t\"notes\": \"The Upper Mississippi River has a history
  of abuse and neglect by Man, resulting in the past contamination of its sediments
  by heavy metals and organic compounds which were toxic or which bioaccumulated in
  its aquatic food chain. Contaminated sediments remain buried today at varying depths
  in its backwaters and navigation pools. Federal and state biologists involved in
  the review of sediment dredging projects along the river are therefore routinely
  required to assess the contaminant implications of those projects to fish and wildlife.
  That assessment requires a degree of confidence in project-related sediment chemistry
  data generated by commercial laboratories which has proven to be unwarranted in
  a number of cases. In some cases, no quality assurance data are provided with analytical
  results. In other cases, the results have been clearly inaccurate in spite of accurately
  reported values for National Bureau of Standards reference sediment. In order to
  be able to attach some estimate of reliability to the data being evaluated for project-related
  impacts, the team developed its own blind reference sediment from Lake Pepin lakebed
  material. Nine commercial, one Federal and four state/university analytical laboratories
  were involved in the development of certified values for 16 heavy metals, DDE, total
  PCBs, and total organic carbon. The reference material, in wet form, has been used
  productively for a variety of projects involving the movement of riverine or lakebed
  sediments. A limited amount of the material can be made available to others facing
  similar issues.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
